Captain Kidd and the Slave Girl (1954 - USA)

Adventure / Action

starring . . . . Anthony Dexter, Eva Gabor, Alan Hale Jr., Sonia Sorel
 &lt;a href=&quot;
http://www.imdb.com/title/tt0046826/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.imdb.com/title/tt0046826/&lt;/a&gt;


Anthony Dexter plays an often bare-chested Captain Kidd while Eva Gabor is the slave girl. Gabor has been dispatched by the villains to seduce Kidd and determine the whereabouts of the pirate's legendary buried treasure. She falls in love with him instead, standing by his side as he fights his way through in good old Hollywood swashbuckler fashion. Notable for the infamous cat-fight scene between Gabor and Sonia Sorel, a female pirate, who looked really cool and sort of out of place in such a studio film.

Regarding the original colour version of this film TCM notes &quot;.....the only print available for viewing was in black and white and devoid of all credits.....the credits were assembled from a studio submitted list.....the film's pressbook and from reviews.....&quot;


